svg.script:
function disableContext() {
  document.oncontextmenu = function() {
    return false;
  }
}

var alternativePatterns = {
  'tail': {
    'layers': ['layer.tail.pattern.seeds', 'layer.tail.pattern.itchy'],
    'idx': 0
  },
  'hair-above': {
    'layers': [
      'layer.hair.above.seeds', 'layer.hair.above.itchy', 'layer.hair.above.bellith',
      'layer.hair.above.id', 'layer.hair.above.misc'
    ],
    'idx': 0
  },
  'hair-below': {
    'layers': [
      'layer.none', 'layer.hair.below.itchy', 'layer.hair.below.bellith',
      'layer.hair.below.id', 'layer.hair.below.misc'
    ],
    'idx': 0
  },
  'eyes': {
    'layers': [
      'layer.eyes.pupils.seeds', 'layer.eyes.pupils.itchy', 'layer.eyes.pupils.heart'
    ],
    'idx': 0
  },
  'underwear-bottom': {
    'layers': [
      'layer.none', 'layer.underwear.bottom'
    ],
    'idx': 1
  },
  'underwear-top': {
    'layers': [
      'layer.none', 'layer.underwear.top'
    ],
    'idx': 1
  },
  'clothes-bottom': {
    'layers': [
      'layer.none', 'layer.clothes.bottom.seeds', 'layer.clothes.bottom.itchy'
    ],
    'idx': 1
  },
  'clothes-top': {
    'layers': [
      'layer.none', 'layer.clothes.top.seeds', 'layer.clothes.top.itchy'
    ],
    'idx': 1
  },
  'clothes-top-above': {
    'layers': [
      'layer.none', 'layer.none', 'layer.clothes.top.itchy.above'
    ],
    'idx': 1
  },
  'socks': {
    'layers': [
      'layer.none', 'layer.socks.seeds', 'layer.socks.itchy'
    ],
    'idx': 1
  },
  'shoes': {
    'layers': [
      'layer.none', 'layer.shoes.seeds', 'layer.shoes.itchy'
    ],
    'idx': 1
  },
  'hat': {
    'layers': [
      'layer.none', 'layer.hat.itchy'
    ],
    'idx': 0
  }
}
function nextPattern(direction, pat) {
  var pattern = alternativePatterns[pat];
  var currentLayer = document.getElementById(pattern['layers'][pattern['idx']]);
  var len = pattern['layers'].length;
  pattern['idx'] = (pattern['idx'] + direction + len) % len;
  var nextLayer = document.getElementById(pattern['layers'][pattern['idx']]);
  currentLayer.style.display = 'none';
  nextLayer.style.display = 'inline';
}

var imageColors = {
  'colorList': [
   'hsl(0, 90%, 30%)', 'hsl(0, 90%, 55%)', 'hsl(0, 90%, 80%)',               /*  0 */
    'hsl(0, 60%, 30%)', 'hsl(0, 60%, 55%)', 'hsl(0, 60%, 80%)',              /*  3 */
    'hsl(30, 90%, 30%)', 'hsl(30, 90%, 55%)', 'hsl(30, 90%, 80%)',        /*  6 */
    'hsl(30, 60%, 30%)', 'hsl(30, 60%, 55%)', 'hsl(30, 60%, 80%)',        /*  9 */
    'hsl(60, 90%, 30%)', 'hsl(60, 90%, 55%)', 'hsl(60, 90%, 80%)',        /* 12 */
    'hsl(60, 60%, 30%)', 'hsl(60, 60%, 55%)', 'hsl(60, 60%, 80%)',        /* 15 */
    'hsl(90, 90%, 30%)', 'hsl(90, 90%, 55%)', 'hsl(90, 90%, 80%)',        /* 18 */
    'hsl(90, 60%, 30%)', 'hsl(90, 60%, 55%)', 'hsl(90, 60%, 80%)',        /* 21 */
    'hsl(120, 90%, 30%)', 'hsl(120, 90%, 55%)', 'hsl(120, 90%, 80%)',  /* 24 */
    'hsl(120, 60%, 30%)', 'hsl(120, 60%, 55%)', 'hsl(120, 60%, 80%)',  /* 27 */
    'hsl(150, 90%, 30%)', 'hsl(150, 90%, 55%)', 'hsl(150, 90%, 80%)',  /* 30 */
    'hsl(150, 60%, 30%)', 'hsl(150, 60%, 55%)', 'hsl(150, 60%, 80%)',  /* 33 */
    'hsl(180, 90%, 30%)', 'hsl(180, 90%, 55%)', 'hsl(180, 90%, 80%)',  /* 36 */
    'hsl(180, 60%, 30%)', 'hsl(180, 60%, 55%)', 'hsl(180, 60%, 80%)',  /* 39 */
    'hsl(210, 90%, 30%)', 'hsl(210, 90%, 55%)', 'hsl(210, 90%, 80%)',  /* 42 */
    'hsl(210, 60%, 30%)', 'hsl(210, 60%, 55%)', 'hsl(210, 60%, 80%)',  /* 45 */
    'hsl(240, 90%, 30%)', 'hsl(240, 90%, 55%)', 'hsl(240, 90%, 80%)',  /* 48 */
    'hsl(240, 60%, 30%)', 'hsl(240, 60%, 55%)', 'hsl(240, 60%, 80%)',  /* 51 */
    'hsl(270, 90%, 30%)', 'hsl(270, 90%, 55%)', 'hsl(270, 90%, 80%)',  /* 54 */
    'hsl(270, 60%, 30%)', 'hsl(270, 60%, 55%)', 'hsl(270, 60%, 80%)',  /* 57 */
    'hsl(300, 90%, 30%)', 'hsl(300, 90%, 55%)', 'hsl(300, 90%, 80%)',  /* 60 */
    'hsl(300, 60%, 30%)', 'hsl(300, 60%, 55%)', 'hsl(300, 60%, 80%)',  /* 63 */
    'hsl(330, 90%, 30%)', 'hsl(330, 90%, 55%)', 'hsl(330, 90%, 80%)',  /* 66 */
    'hsl(330, 60%, 30%)', 'hsl(330, 60%, 55%)', 'hsl(330, 60%, 80%)',  /* 69 */
    'hsl(0, 0%, 30%)', 'hsl(0, 0%, 50%)', 'hsl(0, 0%, 70%)', 'hsl(0, 0%, 90%)'  /* 72 */
  ],
  'body.color.1': 66,
  'body.color.2': 2,
  'eye.white': 75,
  'eye.pupil.left': 54,
  'eye.pupil.right': 70,
  'hair': 17,
  'underwear.bottom': 57,
  'underwear.top': 57,
  'clothes.bottom.1': 69,
  'clothes.bottom.2': 69,
  'clothes.top.1': 8,
  'clothes.top.2': 69,
  'socks.1': 8,
  'socks.2': 8,
  'shoes.1': 69,
  'shoes.2': 69,
  'hat.1': 67,
  'hat.2': 67
};
function changeColorOfClass(cls) {
  var elements = document.getElementsByClassName(cls);
  [].forEach.call(elements,
    function(element, index, array) {
      element.style.fill = imageColors['colorList'][imageColors[cls]];
    });
}
function chooseColor(direction, cls) {
  var len = imageColors['colorList'].length;
  imageColors[cls] = (imageColors[cls] + direction + len) % len;
  changeColorOfClass(cls);
}
function initColors() {
  changeColorOfClass('body.color.1');
  changeColorOfClass('body.color.2');
  changeColorOfClass('eye.white');
  changeColorOfClass('eye.pupil.left');
  changeColorOfClass('eye.pupil.right');
  changeColorOfClass('hair');
  changeColorOfClass('underwear.bottom');
  changeColorOfClass('underwear.top');
  changeColorOfClass('clothes.bottom.1');
  changeColorOfClass('clothes.bottom.2');
  changeColorOfClass('clothes.top.1');
  changeColorOfClass('clothes.top.2');
  changeColorOfClass('socks.1');
  changeColorOfClass('socks.2');
  changeColorOfClass('shoes.1');
  changeColorOfClass('shoes.2');
}
